import './brand.scss';

function Brand() {
  return (
    <div className="Brand">
      <div className="Name">Bryan Min</div>

      <svg className="BrandBlocks" xmlns="http://www.w3.org/2000/svg" width="20" height="40" viewBox="0 0 20 40">
        <path id="Light_Gray" data-name="Light_Gray" d="M0,0H20V20H0Z" fill="#d8dbd3"/>
        <path id="Brand_Black" data-name="Brand_Black" d="M0,0H20V20H0Z" transform="translate(0 20)" fill="#1d1d1d"/>
      </svg>

    </div>




  )
}

export default Brand
